import React from 'react';
import {robots} from './robots';
import SearchBox from './SearchBox'
import CardList from './CardList';

class App extends React.Component{
    constructor(){
        this.state={
            robots:robots,
            searchfield: ''
        }
    }
    render(){
        return(
            <div className='tc'>
                <h1>RoboFriends</h1>
                <SearchBox />
                <CardList robots={robots} />
            </div>
        );
    }

}

export default App;
